    "2013-03-14T15:11:43.608154",nt"name": "emergency-medical-service-point",nt"isopen":
    false,nt"url": null,nt"notes": "Data available online through GeoStor at
    http://www.geostor.arkansas.gov. This dataset contains points which represent the
    locations of all Ambulance Services in the State of Arkansas. The compilation of
    this data is a collaborative effort between the Arkansas Geographic Information
    Office and the Arkansas Department of Health (ADH) to build a comprehensive geographic
    database of Ambulance Services as a component of the National Electronic Disease
    Surveillance System (NEDSS). The Ambulance Services form a sub-component of the
    existing CDC Bioterrorism plan that involves the visualization application for disease
    detection and surveillance. A visual aid of ambulance locations overlaid on current
    digital aerial photography, associated road names, and landmarks, were produced
    to representatives of ADH to confirm the accuracy of the location.",nt"license_title":
